import React from 'react';

const Rank = ({ name, entries }) => {
  return (
    <div>
      <div className='white f3'>
        {`Dear ${name}, you have currently viewed...`}
      </div>
      <div className='white f1'>
        {`${entries} hidden messages`}
      </div>
    </div>
  );
}

export default Rank;
